export async function createLogWriter(name) {
  let file = await Deno.open(name, { 
    write: true,
    create: true,
    truncate: true
  })
  let encoder = new TextEncoder()
  return async function(n = Infinity, delay = 500) {
    while (--n >= 0) {
      if (delay) {
        await sleep(rand(delay))
      }
      let n1 = rand(256)
      let n2 = rand(256)
      let n3 = rand(256)
      let n4 = rand(256)
      let doc = docs[rand(docs.length)]
      let t = new Date().toLocaleString()
      let line = `${n1}.${n2}.${n3}.${n4} - ${t} ${doc}\n`
      await file.write(encoder.encode(line))
    }
  }
}

if (import.meta.main) {
  let [
    name = 'access-log', 
    n = '100', 
    delay = '0',
  ] = Deno.args
  let writeLog = await createLogWriter(name)
  await writeLog(+n, +delay)
}

